  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108082 includes chemical,
  discrete sample, physical and profile data collected from SOUTHERN SURVEYOR in the
  North Pacific Ocean and South Pacific Ocean from 2009-02-03 to 2009-03-24 and retrieved
  during cruise 09SS20090203. These data include ALKALINITY, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE, Potential temperature (theta),
  SALINITY, SILICATE and WATER TEMPERATURE. The instruments used to collect these
  data include Alkalinity titrator, CTD, Coulometer for DIC measurement and bottle.
  These data were collected by Bronte Tilbrook, Bernadette M. Sloyan and Susan Wijffels
  of Commonwealth Scientific and Industrial Research Organization as part of the CLIVAR_P15S_2009
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
